import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import Typewriter from 'typewriter-effect';


const header1 = 'Your passwords aren\'t as secure'
const header2 = 'as you think they are.'
const subheader1 = 'However, we can fix that.'

function HeaderComponent (props) {
    return (
        <Typewriter
            onInit={(typewriter) => {
                typewriter.typeString('<h1>Your passwords aren\'t as secure as you think they are<h1>')
                    .pauseFor(2500)
                    .start();
            }}
        />
    )        
}

function SubHeaderComponent (props) {
        return <h1>{props.sub}</h1>
}


function App () {
    return (
        <div>
            <div id='OpeningHeader'>
                <HeaderComponent header={header1} />
                <HeaderComponent header={header2} />
            </div>
            <div class='text'>
                <SubHeaderComponent sub={subheader1} />
            </div>
        </div>
        )
    }

ReactDOM.render(
    <App />,
    document.getElementById('app')

)
